export class List {
    label: string;
    value: string;
    labelIcon: string;
    fieldType: string;
    link: string;
    buttonClass: string;

    constructor(obj: {
        label?: string;
        value?: string;
        labelIcon?: string;
        fieldType?: string;
        link?: string;
        buttonClass?: string;
    } = {}) {
        Object.assign(this, obj);
    }
}
